import React from 'react';
import banner from "../../Image/Banners.png"
import image from "../../Image/image.png"
import "./Room.css"
const products=[
    {   img:image,
        Heading:'Standered Room'

    },
    {   img:image,
        Heading:'Delux Room'

    },
    {   img:image,
        Heading:'Executive Suit'

    },
]
const Room = (props) => {
    return (
        <div className='wrapper'>
            <img src={banner}  className="banner" alt=""/>
            <div className='container'>
            {products?.map((items,i)=>(
                <div className='row category'>
                <div className='col-md-6'>
                  <img src={items.img} className="image1 text-center" alt=''/>
                  <p className='bottom-right' style={{color:"white"}}>500 USD/Night<i class="fas fa-align-justify" style={{color:"white",marginLeft:"4px"}}></i></p>

                </div>
                <div className='col-md-6'>j
                   <h2>{items.Heading}</h2> 
                    <div className='row'>
                    <p><i class="fas fa-air-freshener"></i>A/C Room</p>
                    <p><i class="fas fa-wifi"></i>Free Wifi</p>
                    <p><i class="fas fa-tv"></i>32'' Led TV</p>
                    <p><i class="fas fa-bath"></i>Bath Tub</p>
                    <p><i class="fas fa-coffee"></i>Coffee maker</p>
                    </div>
                    <button type="button" class=" View">View More</button>
                    </div>
                </div>
            ))}
            </div>
        </div>
    );
};

export default Room;
